/* eslint-disable no-useless-constructor */
import React, { Component} from "react";

class About extends Component {

    constructor(props) {
        super(props)
    }

    render(){
        return(
            <div>
                <p id="aboutSection">
                    {this.props.about}
                </p>
            </div>
        )
    }

}

export default About
